import PokemonItem from "./PokemonItem";

function PokemonList(props){
  return(
    <ul className={classes.list}>
      {props.pokemons.map((pokemon) => (
        <PokemonItem
          image={pokemon.image}
        />
        ))}
    </ul>
  )
}

export default PokemonList;
